import React, {useState} from "react";

function App() {

    const [likes, setLikes] = useState(0)

    const increment = () => {
        setLikes(likes + 1)
    }

    const decrement = () => {
        setLikes(likes - 1)
    }
  return (
    <div className="App">
      <div>
          <h1>{likes}</h1>
      </div>
    </div>
  );
}

export default App;
